:root {
	--progress: 0;
	--purple: #7d7aff;
	--height: 4vh;
}

body,
html {
	padding: 0;
	margin: 0;
	box-sizing: border-box;
	background-color: #181818;
	height: 500vh;
	font-family: "Century Gothic", Futura, sans-serif;
}

#progress-bar {
	width: var(--progress);
	background-color: #fff;
	position: -webkit-sticky;
	position: fixed;
	bottom: 0;
	height: 1px;
}
/* beginning of navbar styling */
#nav {
	position: sticky;
	top: 1px;
}

.nav-container {
	font-size: 16px;
	color: #fff;
	display: flex;
	flex-direction: row;
	height: var(--height);
	align-items: center;
	justify-content: space-between;
	position: -webkit-sticky;
	position: sticky;
	top: 1px;
	text-decoration: none;
	padding: 40px 90px;
}
.nav-item {
	font-size: 18px;
}
.nav-item.name {
	font-weight: 700;
}

.nav-item.name:hover {
	transition: border-color 0.9s ease;
}

.nav-item.name::after {
	content: "";
	display: block;
	width: 0;
	height: 1px;
	background-color: white;
	transition: width 0.9s;
}

.nav-item.name:hover::after {
	width: 100%;
	transition: width 0.9s;
}
.nav-item.contact {
	animation: bounce 1s infinite;
	animation-delay: 2s;
	@keyframes bounce {
		0%,
		100% {
			transform: translateY(-25%);
			animation-timing-function: cubic-bezier(0.8, 0, 1, 1);
		}
		50% {
			transform: translateY(0);
			animation-timing-function: cubic-bezier(0, 0, 0.2, 1);
		}
	}
}
.nav-item.contact {
	text-align: center;
	align-items: center;
	padding: 10px 14px;
	border-radius: 6px;
	background-color: white;
	color: #181818;
	font-weight: 600;
	border: none;
	transition: all 250ms;
	animation: bounce 1s infinite;
}
.nav-item.contact:hover {
	background-color: #dadada;
}
@keyframes bounce {
	0%,
	100% {
		transform: translateY(-8%);
		animation-timing-function: cubic-bezier(0.8, 0, 1, 1);
	}
	50% {
		transform: translateY(0);
		animation-timing-function: cubic-bezier(0, 0, 0.2, 1);
	}
}

.nav-elements.projects > li {
	padding: 0px 15px;
}
.drop-down-list {
	display: flex;

	position: absolute;
	align-items: center;
	left: 46%;
	top: 90%;
	padding: 9px px;
	background-color: rgb(40, 40, 40);
	border-radius: 6px;
}

.drop-down-list li :hover {
	transition: border-color 2s ease;
}

.drop-down-list li ::after {
	content: "";
	display: block;
	width: 0;
	height: 1px;
	background-color: white;
	transition: width 0.9s;
}

.drop-down-list li :hover::after {
	width: 100%;
	transition: width 0.9s;
}

.drop-down-list ul {
	display: block;
	text-align: center;
}
.drop-down-list:not(:hover) {
	visibility: hidden;
	transition: visibility 100ms;
}
.middle-content ul:hover .drop-down-list {
	visibility: visible;
	transform: translateY(0%);
	transition-delay: 0s, 2s, 2s;
}
.drop-down-list:hover {
	visibility: visible;
}

.drop-down-list li {
	padding: 20px;
	align-items: center;
	text-align: center;
}

#portfolio {
	margin: 0px auto;
	margin-left: 30%;
}
.nav-item.link {
	padding: 7px 16px;
	border-radius: 6px;
	transition: all 250ms;
}
.nav-item.link:hover {
	background-color: rgba(255, 255, 255, 0.072);
}
.nav-item.github {
	margin-right: 15px;
}
nav ul,
li {
	display: flex;
	text-decoration: none;
}

.nav-elements {
	display: flex;
	align-items: center;
}

.nav-elements > li > a {
	text-decoration: none;
	color: #fff;
}
.nav-elements.personal > li > a {
	align-items: center;
}

ul > a {
	text-decoration: none;
}
/* end of navbar styling */

/* beginning of about main content */
h1 {
	text-transform: uppercase;
	font-size: 260px;
	font-weight: 900;
	text-align: center;
	color: white;
}
